import './App.css';
import Categories from './Components/Categories';
import Item from './Components/Item';
import {BrowserRouter as Router,   Routes,   Route } from "react-router-dom";


function App() {
  return (

    <Router>
    <div className="App">
       <Categories/>
       <Routes> 
       <Route path="/item/:itemId" element={<Item />} /> 

       </Routes>
    </div>
    </Router>

  );
}

export default App;
